import React from "react";
import Github from "../../images/Github.png";
import Linkedin from "../../images/Linkedin.png";
import Instagram from "../../images/Instagram.png";

const Contact = () => {
  return (
    <div className="container-fluid contact ">
      <div className="row">
        <div className="col-4 d-flex align-items-center justify-content-center border">
          <h3>Contact me</h3>
        </div>
        <div className="col-4 border">
          <div>
            <h5>E-mail: </h5>
            <p>s.rendon.g@gmail.com</p>
          </div>
          <div>
            <h5>Cellphone: </h5>
            <p>3146820353</p>
          </div>
          <div>
            <h5>Ubication: </h5>
            <p>Medellín - Colombia</p>
          </div>
        </div>
        <div className="col-4">
          <div className="row">
          <div className="col-4">
          <a
              href="https://github.com/srendong"
              target="_blank"
              rel="noopener noreferrer"
            >
              <img
                className="img-fluid"
                href="https://www.linkedin.com/in/samuel-rendón-gutiérrez"
                src={Github}
                alt=""
              />
            </a>
          </div>
          <div className="col-4">
          <a
              href="https://www.linkedin.com/in/samuel-rendón-gutiérrez"
              target="_blank"
              rel="noopener noreferrer"
            >
              <img className="img-fluid" src={Linkedin} alt="" />
            </a>
          </div>  
          <div className="col-4">
            <a
              href="https://www.instagram.com/srendong/"
              target="_blank"
              rel="noopener noreferrer"
            >
              <img className="red " src={Instagram} alt="" />
            </a>
          </div>  
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;

